import React, {useEffect, useState} from "react";
import Names from "./Names";

class RandomName extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            nameList: [],
        }
    };

    componentDidMount() {
        const names = [
            this.props.data
        ];
        this.setState({nameList: names})
    }

    onClickTest = () => {
        const names = [
            this.props.data,
        ];
        this.setState({nameList: names})
    }

    render() {
        return (
            <div>
                {this.state.names[Math.floor(Math.random() * names.length)]}
            </div>
        )
    }
}

export default RandomName
